import React from 'react';
import ReactDOM from 'react-dom';

class App extends React.Component{
  constructor(props){
    super();
    this.state = {isActive: false};
  }


  render(){
    if(this.state.isActive){
      console.log('I am active!');
    }

    return (
      <div>
        <h1>Hello, World!</h1>
      </div>
    )
  }
}

ReactDOM.render(
    <App
    />,
    document.getElementById('root')
);
